import React, { useState, useEffect } from "react";
import { AllCards } from "./pages/QuizResult.js";
import { FilterForm } from './pages/QuizForm.js';
import { Routes, Route, Navigate } from 'react-router-dom';
import _ from 'lodash';
import Header from "./components/header";
import Footer from "./components/footer";
import LoginPage from "./pages/SignIn";
import { getAuth } from "firebase/auth"
import { useAuthState } from "react-firebase-hooks/auth";
import LogOutModal from "./pages/LogOut.js";
import CommunityPage from './pages/CommunityPage';
import CommunityDetail from './pages/CommunityDetail';
import HomePage from './pages/HomePage';
import ComparePage from './pages/ComparePage';
import ProfilePage from "./pages/Profile";

const App = (props) => {
  // quiz checkbox
  const [RestaurantData, setRestaurantData] = useState(props.restaurants_data);
  const [order, setOrder] = useState(props.restaurants_data);
  const [filterOptions, setFilterOptions] = useState({
    American: false,
    Chinese: false,
    Indian: false,
    Hawaiian: false,
    Vietnamese: false,
    Japanese: false,
    Mexican: false,
    Mediterranean: false,
    Vegetarian: false,
    Vegan: false,
    'Gluten-free': false, 
    Seafood: false,
    Bar: false,
    Barbeque: false,
    "Venues & Event Spaces": false, 
    Cafe: false, 
    "Breakfast & Brunch": false, 
    Bakeries: false, 
    1: false, 
    2: false,  
    3: false, 
    4: false, 
    5: false, 
    $: false,   
    $$: false, 
    $$$: false,   
    $$$$: false, 
    Desserts: false,  
    Noodles: false,  
    Burgers: false, 
    "Bubble Tea": false,   
    "Hot Pot": false,  
    Tacos: false, 
  });

  const applySort = (value) => {
    if (value === '') {
      setOrder(_.sortBy(order, ['id']))
    }
  }

  const applyFilters = (e) => {
    let filteredData = RestaurantData.filter((restaurant) => {
      if (filterOptions.American) {
        if (!restaurant.category.includes('American')) {
          return false;
        }
      } else if (filterOptions.Chinese) {
        if (!restaurant.category.includes('Chinese')) {
          return false;
        }
      } else if (filterOptions.Indian) {
        if (!restaurant.category.includes('Indian')) {
          return false;
        }
      } else if (filterOptions.Hawaiian) {
        if (!restaurant.category.includes('Hawaiian')) {
          return false;
        }
      } else if (filterOptions.Vietnamese) {
        if (!restaurant.category.includes('Vietnamese')) {
          return false;
        }
      } else if (filterOptions.Japanese) {
        if (!restaurant.category.includes('Japanese')) {
          return false;
        }
      } else if (filterOptions.Mexican) {
        if (!restaurant.category.includes('Mexican')) {
          return false;
        }
      } else if (filterOptions.Mediterranean) {
        if (!restaurant.category.includes('Mediterranean')) {
          return false;
        }
      }
      if (filterOptions.Vegetarian) {
        if (!restaurant.category.includes('Vegetarian')) {
          return false;
        }
      } else if (filterOptions.Vegan) {
        if (!restaurant.category.includes('Vegan')) {
          return false;
        }
      } else if (filterOptions['Gluten-free']) {
        if (!restaurant.category.includes('Gluten-free')) {
          return false;
        }
      } else if (filterOptions.Seafood) {
        if (restaurant.category.includes('Seafood')) {
          return false;
        }
      }
      if (filterOptions.Bar) {
        if (!restaurant.category.includes('Bar')) {
          return false;
        }
      } else if (filterOptions.Barbeque) {
        if (!restaurant.category.includes('Barbeque')) {
          return false;
        }
      } else if (filterOptions["Venues & Event Spaces"]) {
        if (!restaurant.category.includes("Venues & Event Spaces")) {
          return false;
        }
      } else if (filterOptions.Cafe) {
        if (!restaurant.category.includes('Cafe')) {
          return false;
        }
      } else if (filterOptions["Breakfast & Brunch"]) {
        if (!restaurant.category.includes("Breakfast & Brunch")) {
          return false;
        }
      } else if (filterOptions.Bakeries) {
        if (!restaurant.category.includes('Bakeries')) {
          return false;
        }
      }
      if (filterOptions.Desserts) {
        if (!restaurant.category.includes('Desserts')) {
          return false;
        }
      } else if (filterOptions.Noodles) {
        if (!restaurant.category.includes('Noodles')) {
          return false;
        }
      } else if (filterOptions.Desserts) {
        if (!restaurant.category.includes('Desserts')) {
          return false;
        }
      } else if (filterOptions.Burgers) {
        if (!restaurant.category.includes('Burgers')) {
          return false;
        }
      } else if (filterOptions["Bubble Tea"]) {
        if (!restaurant.category.includes("Bubble Tea")) {
          return false;
        }
      } else if (filterOptions["Hot Pot"]) {
        if (!restaurant.category.includes("Hot Pot")) {
          return false;
        }
      } else if (filterOptions.Tacos) {
        if (!restaurant.category.includes('Tacos')) {
          return false;
        }
      }

      if (filterOptions['1']) {
        if (restaurant.star !== "1") {
          return false;
        }
      } else if (filterOptions['2']) {
        if (restaurant.star !== "2") {
          return false;
        }
      } else if (filterOptions['3']) {
        if (restaurant.star !== "3") {
          return false;
        }
      } else if (filterOptions['4']) {
        if (restaurant.star !== "4") {
          return false;
        }
      } else if (filterOptions['5']) {
        if (restaurant.star !== "5") {
          return false;
        }
      }
      if (filterOptions['$']) {
        if (restaurant.price !== "$") {
          return false;
        }
      } else if (filterOptions['$$']) {
        if (restaurant.price !== "$$") {
          return false;
        }
      } else if (filterOptions['$$$']) {
        if (restaurant.price !== "$$$") {
          return false;
        }
      } else if (filterOptions['$$$$']) {
        if (restaurant.price !== "$$$$") {
          return false;
        }
      }
      return true;
    })
    setOrder(filteredData);
  }

  const handleCheckbox = (e) => {
    let name = e.target.name;
    setFilterOptions({ ...filterOptions, [name]: !filterOptions[name] })
  }

  // Start up user authentication
  const [user, loading] = useAuthState(getAuth());
  const currentUser = user;

  // Dealing with log out modal
  const [showLogOut, setShowLogOut] = useState(false);

  return (

    <div className="background">
      <Header user={currentUser} loading={loading} showLogOut={setShowLogOut} />
      <LogOutModal show={showLogOut} setShowLogOut={setShowLogOut} />
      <Routes>
        <Route path="homepage" element={<HomePage restaurants_data={props.restaurants_data} />} ></Route>
        <Route path="community" element={<CommunityPage restaurants_data={props.restaurants_data} />} ></Route>
        <Route path="community/:restaurantName" element={<CommunityDetail restaurants_data={props.restaurants_data} comment_data={props.comment_data}/>} ></Route>
        <Route path="quiz" element={<FilterForm applySortCallback={applySort} applyFilterCallback={applyFilters} data={RestaurantData} filterOptions={filterOptions} handleCheckbox={handleCheckbox} />} >
          <Route index element={<AllCards data={order} />} />
        </Route>
        <Route path="profile" element={<ProfilePage restaurants_data={props.restaurants_data} />} />
        <Route path="compare" element={<ComparePage restaurants_data={props.restaurants_data} />} ></Route>
        <Route path="signin" element={<LoginPage user={currentUser} loading={loading} />} />
        <Route path="*" element={<Navigate to="/homepage" />} />
      </Routes>
      <Footer />
    </div>

  );
}


export default App;
